import { useState } from 'react;'

const Example = () => {
  const [ countA, setCountA ] = useState(10);

  return(
    <>
      <button onClick={() => {
        setCountA(countA + 1)
      }}>ボタンA</button>
    </>
  )
};

export default Example;
